import React from "react";
import { Link } from "react-router-dom";

export const Home = () => {


    return(
        <>
        <h1>Home</h1>
        <nav>
        <Link to="/">Home</Link><br/>
        <Link to="/signup">SignUp</Link><br/>
        <Link to="/login">Login</Link>
        </nav>
        </>
    )
}
